import React from 'react';

const SkillTree = () => {
  const skills = [
    { name: 'Project Management', icon: 'üéØ', level: 'Level 80', unlocked: true, master: false },
    { name: 'Augmented Reality', icon: 'üîÆ', level: 'Level 95 (MASTER)', unlocked: true, master: true },
    { name: 'Design Patterns', icon: 'üèóÔ∏è', level: 'Level 85', unlocked: true, master: false },
    { name: 'Virtual Reality', icon: 'ü•Ω', level: 'Level 90 (MASTER)', unlocked: true, master: true },
    { name: 'Multiplayer', icon: 'üåê', level: 'Level 88', unlocked: true, master: false },
    { name: 'Unity', icon: 'üéÆ', level: 'Level 95 (MASTER)', unlocked: true, master: true },
    { name: 'Game Design', icon: 'üé®', level: 'Level 85', unlocked: true, master: false }
  ];

  return (
    <section id="skills" className="game-section">
      <div className="skill-tree">
        <h2 className="section-title">Skill Tree</h2>
        <div className="skills-unlocked">
          {skills.map((skill, index) => (
            <div key={index} className={`skill-node ${skill.unlocked ? 'unlocked' : ''} ${skill.master ? 'master' : ''}`}>
              <div className="skill-icon">{skill.icon}</div>
              <div className="skill-name">{skill.name}</div>
              <div className="skill-level">{skill.level}</div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default SkillTree;
